import React from "react";
import Container from "@material-ui/core/Container";
import Typography from "@material-ui/core/Typography";
import Box from "@material-ui/core/Box";
import ProTip from "../components/ProTip";
import Link from "../components/Link";
import Copyright from "../components/Copyright";
import { Button } from "@material-ui/core";

//const RequestService = require("../../functions/utils.js");

//var requestService = new RequestService();
let url =
  "https://api.covid19api.com/dayone/country/south-africa/status/confirmed/live";

function httpGet(theUrl) {
  var xmlHttp = new XMLHttpRequest();
  xmlHttp.open("GET", theUrl, false); // false for synchronous request
  xmlHttp.send(null);

  return xmlHttp.responseText;
}

let covidapi = httpGet(url);
console.log(covidapi);

export default function Index() {
  return (
    <Container maxWidth="sm">
      <Box my={4}>
        <Typography variant="h4" component="h1" gutterBottom>
          Hi! Welcome to the Covid App
        </Typography>
        <Link href="https://ananaziz96.github.io/cv/" color="secondary">
          Built with ❤️ by Anan Aziz
        </Link>
        <br />
        <br />
        <Button
          variant="contained"
          color="default"
          component={Link}
          naked
          href="/dashboard"
        >
          Dashboard
        </Button>
        {/* <ProTip /> */}
        {/* <Copyright /> */}
      </Box>
    </Container>
  );
}
